import React, { Component, useEffect } from 'react';

class Api extends Component {
  constructor() {
    super();
    this.state = {
      users: [],
    };
  }

  FetchUsers = () => {
    fetch('https://jsonplaceholder.typicode.com/albums')
      .then((response) => response.json())
      .then((usersList) => {
        this.setState({ users: usersList });
      });
  };
  useEffect() {
    this.FetchUsers;
  }

